import { Link } from 'react-router-dom';

const DUMYEVENTS = [
   { id: 'event-1', Title: 'tytuł-1' },
   { id: 'event-2', Title: 'tytuł-2' },
   { id: 'event-3', Title: 'tytuł-3' },
   { id: 'event-4', Title: 'tytuł-4' },
];

const EventsPage = () => {
   return (
      <>
         <h1>EventsPage</h1>
         <ul>
            {DUMYEVENTS.map((event) => (
               <li key={event.id}>
                  <Link to={`${event.id}`}>{event.id}</Link>
               </li>
            ))}
         </ul>
      </>
   );
};

export default EventsPage;
